import './App.css'
import React from "react";
import Login from "./component/Login"; 

import ForgotPassword from './component/ForgotPassword';
import ResetPassword from './component/ResetPassword';

import 'bootstrap/dist/css/bootstrap.min.css'
function App(){
  return(
    <>
    <Login/>
    <ForgotPassword/>
    <ResetPassword/>
    </>
  )
}
export default App
